import React from 'react';
import './Header.css'; // Assuming you have a CSS file for styling

const Header = () => {
  // Event Handlers for buttons
  const openRegister = () => {
    console.log("Register clicked");
  };

  const openLogin = () => {
    console.log("Login clicked");
  };

  const openHome = () => {
    console.log("Home clicked");
  };

  const openAbout = () => {
    console.log("About clicked");
  };

  const openTravel = () => {
    console.log("Travel clicked");
  };

  const openRelax = () => {
    console.log("Relax clicked");
  };

  const openEat = () => {
    console.log("Eat clicked");
  };

  const instaLink = () => {
    console.log("Instagram clicked");
  };

  const pinLink = () => {
    console.log("Pinterest clicked");
  };

  const faceLink = () => {
    console.log("Facebook clicked");
  };

  const twitterLink = () => {
    console.log("Twitter clicked");
  };

  return (
    <>
      <header className="top-bar">
        <div className="h">
          <h1>We`Blog</h1>
        </div>
        <div id="input3">
          <button type="button" onClick={openRegister}>Register</button>
          <button type="button" onClick={openLogin}>Log in</button>
        </div>
      </header>

      <div id="Tab-bar">
        <div className="Search1">
          <section className="search-button">
            <input type="text" id="input" placeholder="Search..." />
            <button type="button"><i className="fa fa-search"></i></button>
          </section>
        </div>

        <div className="mainbuttons">
          <button className="b1" type="button" onClick={openHome}>Home</button>
          <button className="b1" type="button" onClick={openAbout}>About</button>
          <button className="b1" type="button" onClick={openTravel}>Travel</button>
          <button className="b1" type="button" onClick={openRelax}>Relax</button>
          <button className="b1" type="button" onClick={openEat}>Eat</button>
        </div>

        <div className="fa">
          <button className="b2" type="button" onClick={instaLink}>
            <a href="https://www.instagram.com" className="fa fa-instagram"></a>
          </button>
          <button className="b2" type="button" onClick={pinLink}>
            <a href="https://www.pinterest.com" className="fa fa-pinterest"></a>
          </button>
          <button className="b2" type="button" onClick={faceLink}>
            <a href="https://www.facebook.com" className="fa fa-facebook"></a>
          </button>
          <button className="b2" type="button" onClick={twitterLink}>
            <svg className="i1" xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-twitter-x" viewBox="0 0 16 16">
              <path d="M12.6.75h2.454l-5.36 6.142L16 15.25h-4.937l-3.867-5.07-4.425 5.07H.316l5.733-6.57L0 .75h5.063l3.495 4.633L12.601.75Zm-.86 13.028h1.36L4.323 2.145H2.865z"/>
            </svg>
          </button>
        </div>
      </div>
    </>
  );
};

export default Header;
